DROP TABLE MOCK_USERS;

create table MOCK_USERS (
	userID VARCHAR(50) PRIMARY KEY,
	name VARCHAR(50),
	address VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	zip VARCHAR(50),
	phoneNumber VARCHAR(50),
	gender VARCHAR(50),
	birthday DATE,
	expertise VARCHAR(50),
	email VARCHAR(50),
	password VARCHAR(50),
	securityQuestion VARCHAR(50),
	securityAnswer VARCHAR(50),
	paymentOption VARCHAR(50),
	paymentInfo VARCHAR(50),
	dateEnrolled DATE
);
